        <g *ngIf="namesRevealed">
          <text x="1220" y="420" font-size="124px">{{ gamestate.suspect1.name }}</text>
          <text x="2740" y="740" font-size="124px">{{ gamestate.suspect2.name }}</text>
          <text x="4140" y="580" font-size="124px">{{ gamestate.suspect3.name }}</text>
        </g>
        <rect x="500" y="400" width="1530" height="2800" fill="blue" opacity="0" (click)="suspectClicked(1)"></rect>
        <g [attr.visibility]="gamestate.suspect1.meterVisible">
          <rect x="820" y="520" width="250" height="30" fill="none" stroke="black" stroke-width="3"></rect>
          <rect x="820" y="520" [attr.width]="gamestate.suspect1.meter" height="30" [attr.fill]="gamestate.suspect1.meterColor"></rect>
        </g>
        <rect x="2050" y="400" width="1530" height="2800" fill="blue" opacity="0" (click)="suspectClicked(2)"></rect>
        <g [attr.visibility]="gamestate.suspect2.meterVisible">
          <rect x="2310" y="870" width="250" height="30" fill="none" stroke="black" stroke-width="3"></rect>
          <rect x="2310" y="870" [attr.width]="gamestate.suspect2.meter" height="30" fill="cyan"></rect>
        </g>
        <rect x="3600" y="400" width="1530" height="2800" fill="blue" opacity="0" (click)="suspectClicked(3)"></rect>
        <g [attr.visibility]="gamestate.suspect3.meterVisible">
          <rect x="3770" y="720" width="250" height="30" fill="none" stroke="black" stroke-width="3"></rect>
          <rect x="3770" y="720" [attr.width]="gamestate.suspect3.meter" height="30" fill="cyan"></rect>
        </g>
      </svg>
    
    </div>
    <ion-card-content class="scrollable-content">
      <!-- Chat messages will be displayed here -->
      <div class="chat-container">
        <div *ngFor="let message of messages" class="chat-bubble" [ngClass]="{'align-left': message.sender !== 'player', 'align-right': message.sender === 'player'}">
          <ion-chip>
            <ion-avatar>
              <img [src]="'../../assets/images/'+message.senderName+'-avatar.png'"/>
            </ion-avatar>
            <ion-label style="font-size: 24px">{{ message.sender }}</ion-label>
          </ion-chip>
          <p style="font-size: 18px">
            {{ message.content }}
            <span *ngIf="message.isTyping">[]</span>
          </p>
        </div>
      </div>
    </ion-card-content>
  </ion-card>
  <div class="center-content" [style.visibility]="showCodeLock">
    <ion-row>
      <ion-col>
        <ion-item>
          <ion-input slot="start" type="password" placeholder="Enter code" [(ngModel)]="enteredCode" type="text"></ion-input>
          <ion-button (click)="startGameSession()" [disabled]="!isCodeValid()" outline slot="end">Enter Code</ion-button>
        </ion-item>
        <ion-item lines="none">
          <ion-label slot="start">Voice Mode:</ion-label>
          <ion-toggle [(ngModel)]="gamestate.voiceMode" slot="end"></ion-toggle>
        </ion-item>
        <ion-item lines="none">
          <ion-label slot="start">Local Mode:</ion-label>
          <ion-toggle [(ngModel)]="gamestate.localMultiplayerMode" slot="end"></ion-toggle>
        </ion-item>
        <ion-item lines="none">
          <ion-label slot="start">Variativity:</ion-label>
          <ion-select slot="end"
            placeholder="0.7"
            (ionChange)="handleStabilityChange($event)"
          >
            <ion-select-option value="0.5">0.5</ion-select-option>
            <ion-select-option value="0.7">0.7</ion-select-option>
            <ion-select-option value="0.9">0.9</ion-select-option>
            <ion-select-option value="1.0">1.0</ion-select-option>
          </ion-select>
        </ion-item>
      </ion-col>
    </ion-row>
  </div>
  <!-- QR Code in bottom-right corner -->
  <div class="qr-code-container" *ngIf="showQRCode">
    <ion-card (click)="localPlayerJoin()">
      <ion-card-header>
        <ion-card-title class="ion-text-center" style="font-size: 12px;">{{ gamestate.localMultiplayerMode? 'Tap to join!':'Scan to join!' }}</ion-card-title>
      </ion-card-header>
      <ion-card-content>
        <qrcode [qrdata]="qrCodeUrl" [width]="100" [errorCorrectionLevel]="'M'"></qrcode>
      </ion-card-content>
    </ion-card>
  </div>
</ion-content>

<ion-footer *ngIf="player1joined" class="custom-footer">
  <ion-toolbar>
    <ion-button expand="block" (click)="openModal(1)" [disabled]="!localControllerPlayer1CanSpeak">
      <ion-icon name="person"></ion-icon>
      <ion-icon name="chatbox"></ion-icon>
    </ion-button>
  </ion-toolbar>
</ion-footer>
